Choras „Bel Canto“ (meno vadovas ir dirigentas Egidijus Kaveckas) kartu su šiuo metu prestižinėje Royal Academy of Music Londone studijuojančia soliste Lina Dambrauskaite, Vilniaus miesto styginių ansambliu „Mikroorkéstra“ (meno vadovas Martynas Levickis) ir pianiste Raminta Gocentiene pristatė vieno populiariausių pasaulyje šiuolaikinių norvegų kilmės kompozitorių Ola Gjeilo naujausio kūrinio „Dreamweaver” (liet. Sapnų audėjas) premjerą. Šis šviesus, kino filmų muzikos stiliumi parašytas 20 minučių Kalėdinis kūrinys pasaulyje skambėjo tik antrą kartą. Vilniaus publika taip pat neliko jam abejinga. „Esame dėkingi ir privilegijuoti, kad vienas populiariausių pasaulyje šiuolaikinių kompozitorių Ola Gjeilo pats susisiekė su mumis ir pasiūlė pirmiesiems Lietuvoje atlikti jo naujausią dar niekur neviešintą kūrinį. „Dreamweaver“ užsakė ir pirmą kartą New York „Carnegie“ koncertų salėje atliko „Manhattan Chorale“. Po pasaulinės premjeros 2014 m., kompozitorius tobulino kūrinį, o viešai jis bus paskelbtas tik kitų metų pradžioje. Mums didelė garbė, kad Ola Gjeilo pats atsiuntė mums dar neskelbiamo kūrinio natas ir pasiūlė tapti antruoju choru pasaulyje, atlikusiu „Dreamweaver“. Taip pat džiaugiuosi, kad choras po ilgesnės pertraukos žiūrovams pristatė ir chorui prataikytus populiariosios muzikos, taip pat kitų garsiausių pasaulyje šiuolaikinių kompozitorių kūrinius,“ - teigė Egidijus Kaveckas, „Bel Canto“ meno vadovas. „Su choru „Bel Canto“ esu pažįstama jau labai seniai ir labai džiaugiuosi galimybe kartu atlikti „Dreamweaver“. Ola Gjeilo mano vienas mėgstamiausių kompozitorių, jo „Sunrise Mass“ – tikras šedevras. Šie du koncertai man tapo ne tik kalėdiniu grįžimu pas šeimą, bet ir pas labai išsiilgtą Lietuvos publiką“ – įspūdžiais pasidalino solistė Lina Dambrauskaitė. Be Vilniaus miesto styginių ansamblio „Mikroorkéstra“ muzikantų ir solistės Linos Dambrauskaitės, choras „Bel Canto“ scenoje pasirodė ir su kitais jaunaisiais Lietuvos talentais - soliste Sandra Lebrikaite 